import React from 'react'
import '../styles/HeroScreen.css'; 
import logo from '../img/logo.png'

function HeroScreen() {
    return (
        <div className = "main_hero_screen">
            <div className = "main_hero_screen_container">
                <div className = "main_hero_screen_container_header">
                    <div className = "main_hero_screen_container_header_image">
                        <img src = {logo}/>
                    </div>
                    <div className = "main_hero_screen_container_header_links">
                        <img src = {logo}/>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default HeroScreen;
